import React, { useEffect, useState } from 'react';
import { getInspectionHistory } from '../../api';

// Define the type for an inspection history item
interface Inspection {
    id: string;
    date: string;
    vehiclePlate: string;
    inspectorName: string;
    report: string;
}

const InspectionHistory: React.FC = () => {
    const [history, setHistory] = useState<Inspection[]>([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState<string | null>(null);

    useEffect(() => {
        const loadInspectionHistory = async () => {
            try {
                const data = await fetchInspectionHistory();
                console.log('API inspection history:', data);

                // Map the API data to your interface if needed
                const mapped: Inspection[] = data.map((item: any) => ({
                    id: item.id ?? item._id ?? '',
                    date: item.date ?? '',
                    vehiclePlate: item.vehiclePlate ?? item.plate ?? '',
                    inspectorName: item.inspectorName ?? item.inspector ?? '',
                    report: item.report ?? item.reportText ?? '',
                }));

                setHistory(mapped);
            } catch (err) {
                setError('Failed to load inspection history');
            } finally {
                setLoading(false);
            }
        };

        loadInspectionHistory();
    }, []);

    if (loading) {
        return <div>Loading...</div>;
    }

    if (error) {
        return <div>{error}</div>;
    }

    return (
        <div>
            <h2>Inspection History</h2>
            <ul>
                {history.map((inspection) => (
                    <li key={inspection.id}>
                        <p>Date: {inspection.date}</p>
                        <p>Vehicle Plate: {inspection.vehiclePlate}</p>
                        <p>Inspector: {inspection.inspectorName}</p>
                        <p>Report: {inspection.report}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default InspectionHistory;
